import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import { WrapperDrawer, WrapperNavBar, WrapperButton } from './styled.js';
import LeftMenu from './LeftMenu';
import RightMenu from './RightMenu';
import { MenuOutlined } from '@ant-design/icons';

const NavBar = () => {
  const [visible, setvisible] = useState(false);

  const showDrawer = () => {
    setvisible(true);
  };
  const onClose = () => {
    setvisible(false);
  };
  let history = useHistory();

  const redirect = ({ route }) => {
    history.push(route);
  };
  return (
    <nav>
      {/*<div className='logo'>
        <a href=''>logo</a>
      </div>*/}
      <WrapperNavBar>
        <div>
          <LeftMenu />
        </div>
        <div>
          <RightMenu />
        </div>
      </WrapperNavBar>
      <WrapperButton type='primary' onClick={showDrawer}>
        <MenuOutlined />{' '}
      </WrapperButton>
      <WrapperDrawer
        title='E-commerce'
        placement='right'
        closable={false}
        onClose={onClose}
        visible={visible}>
        <LeftMenu />
        <RightMenu />
      </WrapperDrawer>
    </nav>
  );
};

export default NavBar;
